import React from 'react'

export default function Transaction({transaction}) {
    return (
        <>

        <ul  className="list">
              <li className="minus" key={transaction.id}>
                {transaction.text}
                <span>{transaction.amount}</span>
                <button className="delete-btn">x</button>
              </li>
          </ul>
        </>
      );
      
}
